def read():
    def get_numbers():
        try:
            read.s = input().split()
            read.s_len = len(read.s)
            if(read.s_len==0):get_numbers()
            read.cnt=0
            return 1
        except:
            return 0
    if not hasattr(read, 'cnt'):
        if not get_numbers():
            return 0

    if read.cnt==read.s_len:
        if not get_numbers():
            return 0
    read.cnt+=1

    return eval(read.s[read.cnt-1])


